}

new 키위드를 사용해 객체 생성
Bus tayo = new Bus();

생성자
public class Circle {
    int radius;
    public Circle() {
        radius = 1;
    }
}


클래스 이름과 같게.
여러 생성자 작성 가능.
리턴 타입 없음(언제나 void).
생성자가 없으면 컴파일러가 기본 생성자 자동 삽입.

맴버 변수와 메소드 변수의 이름이 같은 경우 this 사용.
public class Circle {
    int radius;
    public Circle(int radius) {
        this.radius = radius;
    }
}

생성자 내에서 this()를 쓰면 다른 생성자 호출 가능.

생성자 내에서만 사용.
생성자 코드 제일 처음에 사용해야 함.

public class Book {
    String title;
    String author;

    public Book(String title) {
        this(title, "작자미상");
    }
    public Book(String title, String author) {
        this.title = title;
        this.author = author;
    }
}

